import * as React from "react";
import { Routes, Route, Link } from "react-router-dom";
import "../scss/main.scss";

import SnowV2Index from "./SnowV2Index";
import IntelliPower from "./IntelliPower";

const Index = () => {
  return (
    <div className="snow-v2 snow-v2-index">
      <header>
        <h1>SBD Builds</h1>
      </header>

      <section className="section-1 hero">
        <div className="wrapper">
          <Routes>
            <Route path="/" element={<SnowV2Index />} />
            <Route path="intellipower" element={<IntelliPower />} />
          </Routes>

          <ul>
            <li></li>
          </ul>
        </div>
      </section>
    </div>
  );
};

export default Index;
